import './App.css';
import { BrowserRouter, Route, Routes} from 'react-router-dom';


import Home from './Content/Home/Home';
import NoPage from './Content/NoPage/NoPage';
import User from './Content/User/User';
import Bank from './Content/NoPage/NoPage';
import LogIn from './Content/LogIn/LogIn';
import SignUp from './Content/SignUp/SignUp';
import Transaction from './Content/Transaction/Transaction';
import TransactionDetail from './Content/NoPage/NoPage';

function App() {
  return (
    <div className="App">
       <BrowserRouter>
      <Routes>
        <Route path="/Home" element={<Home />} />
          <Route path="/404" element={<NoPage />} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
